The graphql api endpoint is located at `https://api.example.com/graphql`. The mutation you need to execute is:

```graphql
mutation CreateContact($input: CreateContactInput!) {
  createContact(input: $input) {
    id
    name
    email
    phone
    address
    city
    state
    zip
  }
}
```

The input variable is a list of objects with the same structure as the form data. The output of the mutation is an object with the same structure as the input, but with an additional `id` field.

You will need to use the `fetch` function to make the request to the graphql api. You will also need to use the `JSON.stringify` function to convert the form data into a string that can be sent in the request body.

Here is an example of how you might use these functions:

```javascript
const form = document.querySelector('form');
const input = document.querySelector('input');
const button = document.querySelector('button');

button.addEventListener('click', () => {
  const formData = new FormData(form);
  const data = {};
  formData.forEach((value, key) => {
    data[key] = value;
  });
  const json = JSON.stringify(data);
  fetch('https://api.example.com/graphql', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json'
    },
    body: json
  })
    .then(response => response.json())
    .then(data => console.log(data));
});
```

